import React from "react";

function Navbar(){
    return (
<nav class="bg-purple-900 text-white flex justify-between">
        <img src="../public/logo.jpg" class="h-10 pt-2 mt-3 px-3 rounded-3xl" alt="" />
        <ul class="flex mx-24 py-5 space-x-11 justify-end">
            <li class="cursor-pointer hover:text-black">Home</li>
            <li class="cursor-pointer hover:text-black">Contact Us</li>
            <li class="cursor-pointer hover:text-black">About Us</li>
            <button
                class="bg-yellow-500 border-2 rounded-2xl w-20 text-black hover:text-white  hover:bg-yellow-700">Read</button>
        </ul>
    </nav>    );
}

export default Navbar;
